import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

function VisitorLog() {
  const [log, setLog] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/log")
      .then(res => res.text())
      .then(data => {
        const rows = data.trim().split("\n").map(line => line.split(","));
        setLog(rows);
      })
      .catch(() => setLog([]));
  }, []);

  return (
    <div style={{ textAlign: "center", backgroundColor: "#f5f5f5", minHeight: "100vh", paddingTop: "50px" }}>
      <h2>ðŸ“„ Visitor Log</h2>
      <Link to="/"><button>ðŸ”™ Back</button></Link>

      {log.length > 0 ? (
        <table style={{ margin: "30px auto", borderCollapse: "collapse" }}>
          <thead>
            <tr>
              <th>Name</th>
              <th>Date</th>
              <th>Time</th>
            </tr>
          </thead>
          <tbody>
            {log.map((entry, index) => (
              <tr key={index}>
                <td style={{ border: "1px solid gray", padding: "8px" }}>{entry[0]}</td>
                <td style={{ border: "1px solid gray", padding: "8px" }}>{entry[1]}</td>
                <td style={{ border: "1px solid gray", padding: "8px" }}>{entry[2]}</td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No visitors yet.</p>
      )}
    </div>
  );
}

export default VisitorLog;
